            WriteLiteral(@"mcContent"">
                    <h5>Does It Make Sense To Refinance?</h5>
                    <p>
                        Deciding if it makes sense to refinance starts with this question: What are your financial goals? Whether you want to lower your monthly payment,
                        get a lower interest rate, shorten your term or do a cash-out refinance, our refinance calculator can help you determine if refinancing can help you meet your goals.
                    </p>

                    <h5>How Can I Get An Estimate Of My Rate?</h5>
                    <p>
                        Our refinance calculator uses today’s current rates. Once you enter your numbers and pressing “Calculate,” you’ll see a list of recommended loans, terms and rates.
                        If you like what you see, you can get started by contacting a Home Loan Expert or applying online with Rocket Mortgage®.
                    </p>

                    <h5>How Can Refinancing Lower My Monthly Mortgage Payment");
            WriteLiteral(@"?</h5>
                    <p>To lower your monthly payment, look for a refinance option that helps you do one or more of the following:</p>

                    <h5>How Can Refinancing Lower My Monthly Mortgage Payment?</h5>
                    <p class=""pb-2"">To lower your monthly payment, look for a refinance option that helps you do one or more of the following:</p>

                    <ul class=""m-0"">
                        <li>
                            Lock in a lower interest rate - The higher your interest rate, the more you pay for your mortgage, both now and in the future. Refinancing to a loan with a
                            lower rate means you could get a lower payment as long as you don’t shorten the length of your mortgage term.
                        </li>

                        <li>
                            Stop paying for private mortgage insurance (PMI) - If you put less than 20% down on your original home loan, chances are you're paying for PMI. If your home
   ");
            WriteLiteral(@"                         has increased in value and/or you have enough equity, you can refinance to eliminate this costly monthly payment.
                        </li>

                        <li>
                            Get a longer loan term - When you refinance to a longer-term loan, you're stretching the amount you owe over a longer period of time. While you might pay
                            more in interest overall, your monthly payment will decrease.
